@ddrdikko Thanks for the report. Two question:
1. Was this a one off incident or does this happen once in a while? If so how frequently does it happen?
2. Did this crash start happening after some version upgrade, system update or some other change in the environment?

@jasone can you think of any reason why malloc will return NULL in this case, or any other information to we can ask in order to get to the bottom of this.

Some summary: this issue is on a fresh clean centos7 VM with jemalloc 5.1.0.
And we have another recent report (#10234), that started after upgrading from Ubuntu 16.04 to 20.04 (happens with both redis 5.0 using jemalloc 6.2.1, and redis 6.2 using jemalloc 5.1.0)

@ddrdikko your edit didn't trigger a notification, so we missed it.
this seems close enough to be the cause,
can you try to increase it and see if the problem is gone?
